window.bookSummaryJSON = "<p><b>Nathan Briggs left his old life behind, but the galaxy has many secrets...</b></p> <p>A chance encounter with a strange creature puts Nathan on the trail of a lost civilization that predates everything else in the galaxy.</p> <p>For thousands of years, many have abandoned the deadly search, but there are powerful forces that will do anything to possess the promised technological marvels that will change everything.</p> <p>Determined to uncover the truth, Nathan joins the hunt, but when the race for the ultimate prize turns deadly, it will test the loyalty of his crew. To the victor goes the spoils, while the others become yet another tragic end, lost while pursuing the forgotten empire.</p>"; 
